import React, { useEffect, useState } from "react";
import { api } from "../../utils/api";
import Table from "react-bootstrap/Table";

const TableComponent = () => {
  const [users, setUsers] = useState([]);

  const getUsers = () => {
    api
      .getUsers()
      .then((res) => setUsers(res))
      .catch((err) => new Error(err));
  };

  useEffect(() => {
    getUsers();
  }, []);

  console.log(users);

  return (
    <Table responsive style={{ marginLeft: "98px" }}>
      <thead>
        <tr>
          <th rowSpan={2}>Имя сотрудника</th>
          <th colSpan={6}>Основная информация</th>
          <th colSpan={2}>Банковская информация</th>
          <th cl>Документы сотрудника</th>
          <th>Информация от HR</th>
        </tr>
        <tr>
          <th>ID номер</th>
          <th>Телефона</th>
          <th>Пол</th>
          <th>Дата рождения</th>
          <th>Метро</th>
          <th>Адрес проживания</th>
          <th>Банк</th>
          <th>Номер карты</th>
          <th>Гражданство</th>
          <th>Пасспорт</th>
          <th>Кем выдан</th>
          <th>Срок действия</th>
          <th>Место рождения</th>
          <th>Адрес прописки</th>
          <th>Патент</th>
          <th>Срок действия</th>
          <th>СНИЛС</th>
          <th>ИНН</th>
          <th>Мед.книжка</th>
          <th>Должность</th>
          <th>Поразделение</th>
          <th>Решение</th>
          <th>Источник</th>
          <th>Дата</th>
          <th>Примечание</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>1</td>
          {Array.from({ length: 5 }).map((_, index) => (
            <td key={index}>Table cell {index}</td>
          ))}
        </tr>
        <tr>
          <td>2</td>
          {Array.from({ length: 5 }).map((_, index) => (
            <td key={index}>Table cell {index}</td>
          ))}
        </tr>
        <tr>
          <td>3</td>
          {Array.from({ length: 5 }).map((_, index) => (
            <td key={index}>Table cell {index}</td>
          ))}
        </tr>
      </tbody>
    </Table>
  );
};

export default TableComponent;
